column18:
Specialty: <ancestralprimary>{Sieging and Defending Ancestral Totems}

Tribal Passive: <enchanted>{Cannot be Slowed or Stunned
Overwhelms Physical Damage Reduction}

<ancestralprimary>{Totemic Protection}
Gives up some of its own defences to protect totems around it, making those totems invulnerable as long as the Titanic Shell is alive. The Titanic Shell takes More Damage while using Totemic Protection

<ancestralprimary>{Unstoppable}
If in Flanking position, Titanic Shell cannot be knocked back, stunned, or interrupted while destroying a totem.

column19:
Spécialité : <ancestralprimary>{Siège et Défense de Totems ancestraux}

Passif tribal : <enchanted>{Ne peut être Ralenti ou Étourdi
Submerge la Réduction des Dégâts physiques}

<ancestralprimary>{Protection totémique}
Sacrifie une partie des ses défenses pour protéger les totems autour d'elle, rendant ces totems invulnérables tant que la Carapace titanesque est en vie. La Carapace titanesque subit davantage de dégâts lorsqu'elle utilise Protection totémique

<ancestralprimary>{Inarrêtable}
Si elle est en position de flanqueuse, la Carapace titanesque ne peut être repoussée, étourdie ou interrompue pendant qu'elle détruit un totem

column20:
Spezialität: <ancestralprimary>{Belagerung und Verteidigung von Ahnen-Totems}

Stammes-Passive: <enchanted>{Kann nicht verlangsamt oder betäubt werden
Überwältigt physische Schadensminderung}

<ancestralprimary>{Totem-Schutz}
Verzichtet auf einen Teil der eigenen Defensive und schützt andere Totems um sich herum und macht diese unverwundbar, solange der Titanenpanzer am Leben ist. Der Titanenpanzer erleidet mehr Schaden, während er den Totem-Schutz einsetzt

<ancestralprimary>{Unaufhaltsam}
In der Flanken-Position kann der Titanenpanzer nicht zurückgestoßen oder unterbrochen werden, während er ein Totem zerstört.

column21:
特技：<ancestralprimary>{先祖のトーテムの包囲と防御}

部族のパッシブ：<enchanted>{減速状態にならずスタンを受けることがない
物理ダメージ軽減を圧倒する}

<ancestralprimary>{トーテムの守り}
自身の防御の一部を捨てて周囲のトーテムを守り、巨大な甲羅が生きている間そのトーテムを無敵にする。トーテムの守りを使用中は巨大な甲羅が受けるダメージが上昇する。

<ancestralprimary>{止まらぬ者}
フランキングポジションにいる場合、巨大な甲羅はトーテムを破壊中にノックバック、スタン、妨害を受けることがない。

column22:
특기: <ancestralprimary>{선조 토템 포위 공격 및 방어}

부족 패시브: <enchanted>{느려지거나 기절하지 않음
물리 피해 감소 압도}

<ancestralprimary>{토템 보호}
자신의 방어력의 일부를 포기하는 대신 주변 토템을 보호해 거대한 껍질이 살아있는 동안 무적으로 만듭니다. 토템 보호를 사용하는 동안 거대한 껍질이 받는 피해가 증폭됩니다.

<ancestralprimary>{폭주}
거대한 껍질이 측면 공략자 역할을 할 때 토템을 파괴하는 동안 밀려나거나, 기절하거나, 방해받지 않습니다.

column23:
Especialidade:<ancestralprimary>{Cerco e Defesa de Totens Ancestrais}

Passiva Tribal: <ancestralprimary>{Não pode ser Desacelerado ou Atordoado
Sobrecarrega a Redução de Dano Físico}

<ancestralprimary>{Proteção Totêmica}
Abdica de um pouco de sua própria defesa para proteger totens ao redor, tornando-os invulneráveis contanto que o Casco Titânico esteja vivo. O Casco Titânico sofre Mais Dano enquanto usa Proteção Totêmica

<ancestralprimary>{Implácável}
Se estiver na posição de Flanqueamento, o Casco Titânico não pode ser empurrado, atordoado ou interrompido enquanto destrói um totem.

column24:
Специализация: <ancestralprimary>{Осаждение и защита тотемов предков}

Племенное умение: <enchanted>{Нельзя оглушить или замедлить
Подавляет уменьшение получаемого физического урона}

<ancestralprimary>{Тотемная защита}
Жертвует частью собственной защиты ради защиты тотемов вокруг себя, делая их неуязвимыми, пока громадный панцирь жив. Громадный панцирь получает больше урона во время использования Тотемной защиты
{Неостановимый}
Если находится на фланге, громадный панцирь нельзя отбросить, оглушить или прервать в момент уничтожения тотема.

column25:
Especialidad: <ancestralprimary>{Asedio y defensa de tótems ancestrales}

Pasiva tribal: <enchanted>{No puede ser ralentizado ni aturdido
Sobrepasa la reducción de daño físico}

<ancestralprimary>{Protección totémica}
Renuncia a una parte de sus defensas para proteger a los tótems de su alrededor y volverlos invulnerables mientras Caparazón titánico esté vivo. Caparazón titánico recibe más daño mientras usa Protección totémica

<ancestralprimary>{Imparable}
Si se encuentra en una posición de flanqueador, Caparazón titánico no puede ser empujado, aturdido ni interrumpido mientras destruye un tótem.

column26:
สาย: <ancestralprimary>{จู่โจมและป้องกันโทเทมต้นตระกูล}

พาสซีฟเผ่า: <enchanted>{ไม่​ถูก​ทำให้ เชื่องช้า และ​ไม่​ติด​สถานะ มึนงง
ท่วมท้น ค่า​ป้องกัน​กายภาพ

<ancestralprimary>{คุ้มครองโทเทม (Totemic Protection)}
เสียสละ ค่าป้องกัน บางส่วน​ของ​มัน​เพื่อ​คุ้มครอง​โทเทม ทำให้​โทเทม​รอบตัว​มัน เป็น​อมตะ​ตราบใด​ที่​ กระดองมโหฬาร ยัง​มี​ชีวิต​อยู่ โดย​กระดองมโหฬาร​จะ​ได้รับ​ความ​เสียหาย เพิ่มขึ้น ​อีก ขณะที่ใช้ คุ้มครองโทเทม

<ancestralprimary>{ไม่อาจหยุดยั้ง (Unstoppable)}
หาก​อยู่​ใน ตำแหน่งขนาบข้าง กระดอง​มโหฬาร จะ​ไม่​ถูก​ผลัก​ออก​ไป, ป้องกัน​สถานะ มึนงง และ​ไม่​ถูก​รบกวน​ขณะ ทำลายโทเทม

column27:
特性: <ancestralprimary>{進攻和防禦祖靈圖騰}

部落天賦: <enchanted>{不能被緩速或暈眩
鎮壓物理傷害減免}

<ancestralprimary>{圖騰保護}
放棄自身的部分防禦來保護附近的圖騰，使這些圖騰在泰坦巨盾存在的情況下保持無敵。使用圖騰保護時，泰坦巨盾會受到更高傷害。

<ancestralprimary>{勢不可擋}
如果處於側翼位置，泰坦巨盾在摧毀圖騰時無法被擊退、眩暈或打斷。

column18:
Specialty: <ancestralprimary>{Prevents Reviving}

Tribal Passive: <enchanted>{Leech Resistant}

<ancestralprimary>{Spirit Consumption}
Feasts upon the spirit of a corpse, pausing their revive for up to 10 seconds while it continues to feast

column19:
Spécialité : <ancestralprimary>{Empêche la réapparition}

Passif tribal : <enchanted>{Résistant au Drain}

<ancestralprimary>{Ingestion de l'esprit}
Se repaît de l'esprit d'un cadavre, l'empêchant de réapparaître pendant 10 secondes

column20:
Spezialität: <ancestralprimary>{Verhindert das Wiederbeleben}

Stammes-Passive: <enchanted>{Widersteht Raub}

<ancestralprimary>{Geisterverzehr}
Verzehrt den Geist einer Leiche und verhindert deren Wiederbelebung für 5 Sekunden

column21:
特技：<ancestralprimary>{復活の妨害}

部族のパッシブ：<enchanted>{リーチ耐性}

<ancestralprimary>{精気摂取}
死体の精気を貪り、貪っている間そのリスポーンを最大10秒間阻害する。

column22:
특기: <ancestralprimary>{부활 방지}

부족 패시브: <enchanted>{흡수 저항}

<ancestralprimary>{혼백 섭취}
시신의 혼백을 먹어 치워 혼백을 먹는 동안 최대 10초간 부활을 멈추게 합니다.

column23:
Especialidade: <ancestralprimary>{Impede Ressurgimentos}

Passiva Tribal:<ancestralprimary>{Resistênte a Dreno}

<ancestralprimary>{Consumo de Espíritos}
Devora o espírito de um cadáver, impedindo seu ressurgimento por até 10 segundos

column24:
Специализация: <ancestralprimary>{Предотвращает возрождение}n
Племенное умение: <enchanted>{Сопротивляется похищению}

<ancestralprimary>{Поглощение духа}
Пирует на духе трупа, не позволяя ему воскреснуть в течение 10 секунд

column25:
Especialidad: <ancestralprimary>{Impide la resurrección}

Pasiva tribal: <enchanted>{Resistente a la absorción}

<ancestralprimary>{Ingesta de espíritus}
Devora el espíritu de un cadáver y pausa su resurrección durante 10 segundos mientras sigue devorando

column26:
สาย: <ancestralprimary>{ขัดขวางการคืนชีพ}

พาสซีฟเผ่า: <enchanted>{ต้านทานการ ดูด}

<ancestralprimary>{กลืนกินวิญญาณ (Spirit Consumption)}
กัด​กิน​วิญญาณ​ของ​ศพ หยุด​เวลา​​การ​คืน​ชีพ​สูงสุด 10 วินาที ขณะ​ที่​มัน​กำลัง​กลืนกิน

column27:
特性: <ancestralprimary>{無法復活}

部落天賦: <enchanted>{偷取抗性}

<ancestralprimary>{吞噬靈魂}
吞噬屍體的靈魂，阻止它們在 10 秒內復活

column18:
Specialty: <ancestralprimary>{Mobile}

Tribal Passive: <enchanted>{Critical Resistant}

<ancestralprimary>{Lightning Warp}
Teleports the Thunderbird, dealing damage at the start and end locations. Used to reach targets faster

column19:
Spécialité : <ancestralprimary>{Mobile}

Passif tribal :<enchanted>{Résistant aux Critiques}

<ancestralprimary>{Téléportation foudroyante}
Téléporte l'Oiseau-tonnerre, infligeant des dégâts à son emplacement de départ et à son emplacement d'arrivée. Utilisé pour atteindre les cibles plus rapidement

column20:
Spezialität: <ancestralprimary>{Mobil}

Stammes-Passive: <enchanted>{Widersteht kritischen Treffern}

<ancestralprimary>{Blitzteleportation}
Teleportiert den Donnervogel und verursacht Schaden am Start- und Zielort. Wird verwendet, um Ziele schneller zu erreichen

column21:
特技：<ancestralprimary>{機動性}

部族のパッシブ：<enchanted>{クリティカル耐性}

<ancestralprimary>{ライトニングワープ}
サンダーバードをテレポートさせ、出発点と到着点にダメージを与える。対象に素早く到達するために使用される。

column22:
특기: <ancestralprimary>{기동성}

부족 패시브: <enchanted>{치명타 저항}

<ancestralprimary>{번개 차원 이동}
천둥새가 순간이동해 출발 지점과 도착 지점에 피해를 줍니다. 대상에 더 빨리 도달하는 데 사용됩니다.

column23:
Especialidade:<ancestralprimary>{Móvel}

Passiva Tribal:<ancestralprimary>{Resistênte a Crítico}<ancestralprimary>

{Teleporte Relampejante}
Teleporta o Pássaro Trovejante, causando dano no local de início e no fim. Usado para alcançar os alvos rapidamente

column24:
Специализация: <ancestralprimary>{Мобильность}

Племенное умение: <enchanted>{Сопротивляется критическим ударам}

<ancestralprimary>{Грозовой переход}
Переносит Громовую птицу с места на место, нанося урон в начальной и конечной точках. Позволяет быстрее добраться до цели

column25:
Especialidad: <ancestralprimary>{Movilidad}

Pasiva tribal: <enchanted>{Resistente a los golpes críticos}

<ancestralprimary>{Teletransporte de rayo}
Teletransporta al Ave de trueno e inflige daño en las ubicaciones iniciales y finales. Se usa para llegar más rápido a los objetivos

column26:
สาย: <ancestralprimary>{คล่องตัว}

พาสซีฟเผ่า: <enchanted>{ต้านทานคริติคอล}

<ancestralprimary>{วาร์ปสายฟ้า (Lightning Warp)}
นก​ธันเดอร์เบิร์ด​เทเลพอร์ต เพื่อ​สร้าง​ความ​เสีย​หาย​ทั้ง​ตำแหน่ง​ต้นทาง​และ​ปลาย​ทาง ใช้​เพื่อ​ให้​ไป​ถึง​เป้าหมาย​ได้​เร็ว​ขึ้น

column27:
特性: <ancestralprimary>{行動派}

部落天賦: <enchanted>{暴擊抗性}

<ancestralprimary>{閃電傳送}
傳送雷鳥，對起點和終點位置造成傷害。加速到達目的地

column18:
Specialty: <ancestralprimary>{Leeches Life to Totem}

Tribal Passive: <enchanted>{Leech Resistant}

<ancestralprimary>{Bloodbond}
If the Warrior's totem is attacked when they are not nearby, they will teleport back to their totem to defend it

column19:
Spécialité : <ancestralprimary>{Draine de la vie au Totem}

Passif tribal : <enchanted>{Résistant au Drain}

<ancestralprimary>{Lien du sang}
Si son totem est attaqué alors qu'il n'est pas à proximité, le Guerrier se téléporte auprès de lui pour le défendre

column20:
Spezialität: <ancestralprimary>{Raubt für das Totem Leben}

Stammes-Passive: <enchanted>{Widersteht Raub}

<ancestralprimary>{Blutsbande}
Wird das Totem des Kriegers angegriffen, wenn er nicht in der Nähe ist, teleportiert er sich zu seinem Totem zurück, um es zu verteidigen

column21:
特技：<ancestralprimary>{リーチしたライフをトーテムに}

部族のパッシブ：<enchanted>{リーチ耐性}

<ancestralprimary>{血の絆}
ウォーリアーのトーテムが攻撃された時に近くにいない場合、ウォーリアーは彼らのトーテムにテレポートしトーテムを防衛する。

column22:
특기: <ancestralprimary>{흡수로 토템 생명력 회복}

부족 패시브: <enchanted>{흡수 저항}

<ancestralprimary>{피붙이}
전사가 주변에 없을 때 전사의 토템이 공격받으면 전사가 토템으로 순간이동해 보호합니다.

column23:
Especialidade: <ancestralprimary>{Dreno de Vida para o Totem}

Passiva Tribal:<ancestralprimary>{Resistênte a Dreno}

<ancestralprimary>{Pacto de Sangue}
Se o totem de um Guerreiro for atacado quando ele não estiver próximo, ele teleportará de volta ao totem para defendê-lo

column24:
Специализация: <ancestralprimary>{Похищает здоровье для тотема}

Племенное умение: <enchanted>{Сопротивляется похищению}

<ancestralprimary>{Общая плоть}
Если тотем воина атакуют в его отсутствие, то он перенесётся обратно к тотему для его защиты

column25:
Especialidad: <ancestralprimary>{Absorbe vida para el tótem}

Pasiva tribal: <enchanted>{Resistente a la absorción}

<ancestralprimary>{Vínculo sangriento}
Si el tótem del guerrero recibe un ataque cuando él no está cerca, se teletransporta a su tótem para defenderlo

column26:
สาย: <ancestralprimary>{ดูดพลังชีวิตให้กับโทเทม}

พาสซีฟเผ่า: <enchanted>{ต้านทานการ ดูด}

<ancestralprimary>{พันธะโลหิต (Bloodbond)}
หาก​โทเทม​ของ​นักรบ​ถูก​โจมตี​ขณะ​ที่​เขา​ไม่​อยู่​ใกล้ เขา​จะ​เทเลพอร์ต​กลับ​ไป​ปกป้อง​โทเทม​ของ​เขา

column27:
特性: <ancestralprimary>{偷取生命給圖騰}

部落天賦: <enchanted>{偷取抗性}

<ancestralprimary>{血肉結合}
如果戰士的圖騰在戰士不在附近被攻擊時，戰士會傳送回他們的圖騰來保護它

column18:
Specialty: <ancestralprimary>{Melee Combatant}

Tribal Passive: <enchanted>{Ignores some Enemy Block Chance
Unaffected By Taunt}

<ancestralprimary>{Leap Slam}
Leap Slam moves the Hulk and deals damage in an area where it lands

<ancestralprimary>{Tackle}
Charges forward, knocking back any enemies hit

column19:
Spécialité : <ancestralprimary>{Combattant de mêlée }

Passif tribal : <enchanted>{Ignore une partie des chances de Bloquer ennemi
Insensibilité à la Provocation}

<ancestralprimary>{Bond percutant}
Bond percutant déplace le Mastodonte et inflige des dégâts dans une zone entourant l'endroit de son atterrissage

<ancestralprimary>{Plaquage}
Charge vers l'avant, repoussant tous les ennemis touchés

column20:
Spezialität: <ancestralprimary>{Nahkämpfer}

Stammes-Passive: <enchanted>{Ignoriert teilweise gegnerische Blockchance
Unbeeinträchtigt von Verspotten}

<ancestralprimary>{Sprunghieb}
Sprunghieb bewegt den Riesen und verursacht Schaden in einem Bereich, in dem er landet

<ancestralprimary>{Angriff}
Stürmt nach vorne und stößt getroffene Gegner zurück

column21:
特技：<ancestralprimary>{近接戦闘}

部族のパッシブ：<enchanted>{敵のブロック率の一部を無視する
挑発の影響を受けない}

<ancestralprimary>{リープスラム}
リープスラムは大男を移動させ、着地点にダメージを与える。

<ancestralprimary>{タックル}
前方に突撃し、ヒットした敵をノックバックする。

column22:
특기: <ancestralprimary>{근접 전투원}

부족 패시브: <enchanted>{일부 적 막기 확률 무시
도발의 영향을 받지 않음}

<ancestralprimary>{도약 강타}
도약 강타를 사용하면 거한이 이동하여 착지하는 지역에 피해를 줍니다.

<ancestralprimary>{들이받기}
전방으로 돌진하여 명중하는 적을 밀어냅니다.

column23:
Especialidade: <ancestralprimary>{Combatente Corpo a Corpo}

Passiva Tribal: <ancestralprimary>{Ignora parte da Chance de Bloqueio Inimiga
Não Afetado por Provocações}

<ancestralprimary>{Salto Impactante}
O Salto Impactante move o Bruto e causa dano na área em que cair

<ancestralprimary>{Agarrão}
Investe Adiante, empurrando os inimigos que acertar

column24:
Специализация: <ancestralprimary>{Боец ближнего боя}

Племенное умение: <enchanted>{Игнорирует некоторый процент шанса блока противника
Невосприимчив к провокации}

<ancestralprimary>{Наскок}
Наскок перемещает колосса и наносит урон в месте приземления

<ancestralprimary>{Бросок}
Устремляется вперёд, отбрасывая всех задетых противников

column25:
Especialidad: <ancestralprimary>{Combatiente cuerpo a cuerpo}

Pasiva tribal: <enchanted>{Ignora una parte de la probabilidad de bloqueo de los enemigos
No le afecta la provocación}

<ancestralprimary>{Salto con impacto}
Salto con impacto desplaza al gigante e inflige daño en área allá donde aterriza

<ancestralprimary>{Placaje}
Carga hacia delante y empuja a todos los enemigos que golpea

column26:
สาย: <ancestralprimary>{ผู้ต่อสู้ประชิด}

พาสซีฟเผ่า: <enchanted>{มองข้ามโอกาสบล็อคบางส่วนของศัตรู
ไม่ได้รับผลจากสถานะ ยั่วยุ}

<ancestralprimary>{กระโจนทุบ (Leap Slam)}
ยักษ์หยก กระโจน​ทุบ เพื่อ​เคลื่อนที่​ไป​สร้าง​ความ​เสียหาย​ใน​พื้นที่​ที่​มัน​ลง

<ancestralprimary>{พุ่งชน (Tackle)}
พุ่ง​ไป​ข้างหน้า เพื่อ​ผลัก​ศัตรู​ที่​ถูก​ปะทะ​ออก​ไป

column27:
特性: <ancestralprimary>{近戰鬥士}

部落天賦: <enchanted>{無視部分敵人格擋率
不被嘲諷影響}

<ancestralprimary>{躍擊}
躍擊使巨像移動，並對它落下的位置造成範圍傷害

<ancestralprimary>{撞擊}
向前衝，擊退擊中的敵人

column18:
Specialty: <ancestralprimary>{Buffs Allies on Death}

Tribal Passive: <enchanted>{Leech Resistant}

<ancestralprimary>{Power in Death}
When the Frenzymonger dies, all allies gain damage, damage reduction, and reduce enemy life regeneration on hit for the remainder of the match

column19:
Spécialité : <ancestralprimary>{Donne des effets bénéfiques aux alliés en mourant}

Passif tribal : <enchanted>{Résistant au Drain}

<ancestralprimary>{Pouvoir funèbre}
Lorsque le Frénésiste meurt, tous les alliés gagnent des dégâts, de la réduction des dégâts subis et réduisent la régénération de vie des ennemis au toucher pour le restant du match

column20:
Spezialität: <ancestralprimary>{Stärkt Verbündete bei Tod}

Stammes-Passive: <enchanted>{Widersteht Raub}

<ancestralprimary>{Macht im Tod}
Wenn der Rasende Schlächter stirbt, erhalten alle Verbündeten für den Rest des Wettkampfes Schaden, Schadensminderung und eine Verringerung der gegnerischen Lebensregeneration bei Treffer

column21:
特技：<ancestralprimary>{死亡時味方にバフ}

部族のパッシブ：<enchanted>{リーチ耐性}

<ancestralprimary>{死の力}
フレンジーモンガーが死亡した時、試合の残り時間中、すべての味方はダメージ、ダメージ軽減、敵をヒット時に敵のライフ回復減少を得る。

column22:
특기: <ancestralprimary>{사망 시 아군 버프}

부족 패시브: <enchanted>{흡수 저항}

<ancestralprimary>{사후의 힘}
격분의 투사가 사망하면 모든 아군이 시합이 끝날 때까지 피해, 피해 감소, 명중 시 적 생명력 재생 감소를 획득합니다.

column23:
Especialidade: <ancestralprimary>{Buffa os Aliados ao Morrer}

Passiva Tribal: <ancestralprimary>{Resistênte a Dreno}

<ancestralprimary>{Poder ao Morrer}
Quando o Frenético morrer, todos os aliados ganham dano, redução de dano e redução da regeneração de vida dos inimigos ao acertarem pelo resto da partida

column24:
Специализация: <ancestralprimary>{Усиливает союзников при смерти}

Племенное умение: <enchanted>{Сопротивляется похищению}

<ancestralprimary>{Сила в смерти}
Когда несущий ярость умирает, все союзники до конца матча получают прибавку к урону, уменьшение получаемого урона, и уменьшают регенерацию здоровья противников при нанесении удара

column25:
Especialidad: <ancestralprimary>{Potencia a los aliados al morir}

Pasiva tribal: <enchanted>{Resistente a la absorción}

<ancestralprimary>{Poder tras la muerte}
Cuando el Guerrero frenético muere, todos los aliados obtienen daño y reducción de daño, además reduce la regeneración de vida de los enemigos con cada golpe durante el resto del combate

column26:
สาย: <ancestralprimary>{มอบบัฟให้เพื่อนเมื่อตาย}

พาสซีฟเผ่า: <enchanted>{ต้านทานการ ดูด}

<ancestralprimary>{พลังยามตาย (Power in Death)}
เมื่อ​ผู้​แพร่​ความ​คลั่ง​ตาย เพื่อน​ทั้งหมด​จะมี ความ​​เสียหาย​และ​การ​ป้องกัน​ความ​เสียหาย เพิ่มขึ้น และ​ลด​การ ฟื้นฟู​พลังชีวิต ของ​ศัตรู​เมื่อ​ปะทะ ตลอด​การ​แข่งขัน​ครั้ง​นี้

column27:
特性: <ancestralprimary>{死亡時增益友方}

部落天賦: <enchanted>{偷取抗性}

<ancestralprimary>{意志傳承}
當狂亂商人死亡時，全部友方在對局剩餘的時間，增加傷害、傷害減免和擊中時減少敵人生命回復

column18:
Specialty: <ancestralprimary>{Prevents Reviving
Speeds up Reviving}

Tribal Passive: <enchanted>{Curse Resistant}

<ancestralprimary>{Spiritual Capture}
Plays near totems of fallen enemies, pausing their revive for 5 seconds

<ancestralprimary>{Bolstering Spirit}
Plays near totems of fallen Teammates, bringing them back to life faster

column19:
Spécialité : <ancestralprimary>{Empêche la réapparition
Accélère la réapparition}

Passif tribal : <enchanted>{Résistant aux Malédictions}

<ancestralprimary>{Envoûtement spirituel}
Joue une note plaintive qui empêche tous les totems ennemis à proximité de réapparaître pendant 5 secondes

<ancestralprimary>{Esprit renforçant}
Joue sur le totem d'un allié tombé au combat, le ramenant à la vie plus rapidement

column20:
Spezialität: <ancestralprimary>{Verhindert das Wiederbeleben
Beschleunigt das Wiederbeleben}

Stammes-Passive: <enchanted>{Widersteht Flüchen}

<ancestralprimary>{Geisterfänger}
Spielt in der Nähe von Totems gefallener Gegner und pausiert deren Wiederbelebung für 5 Sekunden

<ancestralprimary>{Geisterverstärker}
Spielt in der Nähe von Totems gefallener Verbündeter und erweckt diese schneller wieder zum Leben

column21:
特技：<ancestralprimary>{復活の妨害
復活の加速}

部族のパッシブ：<enchanted>{呪い耐性}

<ancestralprimary>{精神の捕獲}
倒れた敵のトーテムの近くで演奏し、リスポーンを5秒間阻害する。

<ancestralprimary>{強化される魂}
倒れたチームメイトのトーテムに向けて演奏し、より早く生き返らせる。

column22:
특기: <ancestralprimary>{부활 방지
부활 가속}

부족 패시브: <enchanted>{저주 저항}

<ancestralprimary>{혼백 포획}
쓰러진 적의 토템 근처에서 연주해 5초 동안 적의 부활을 멈추게 합니다.

<ancestralprimary>{혼백 강화}
쓰러진 팀원의 토템 근처에서 연주해 아군이 더 빨리 부활하게 합니다.

column23:
Especialidade: <ancestralprimary>{Impede Ressurgimentos
Agiliza Ressurgimentos}

Passiva Tribal: <ancestralprimary>{Resistênte a Maldições}

<ancestralprimary>{Captura Espiritual}
Toca próximo dos totens de inimigos caídos, pausando seu ressurgimento por 5 segundos

<ancestralprimary>{Reforço Espiritual}
Toca próximo do totem de um aliado caído, trazendo-o de volta à vida mais rápido

column24:
Специализация: <ancestralprimary>{Предотвращает возрождение
Ускоряет возрождение}

Племенное умение: <enchanted>{Сопротивляется проклятиям}

<ancestralprimary>{Захват духа}
Издаёт скорбный зов рядом с вражескими воинами или тотемами, не позволяя воскрешаться им в течение 5 секунд

<ancestralprimary>{Подкрепление духа}
Играет песнь вблизи тотемов павших членов команды, быстрее возвращая их к жизни

column25:
Especialidad: <ancestralprimary>{Impide la resurrección
Acelera la resurrección}

Pasiva tribal: <enchanted>{Resistente a las maldiciones}

<ancestralprimary>{Captura espiritual}
Toca cerca de los tótems de los enemigos caídos y pausa su resurrección durante 5 segundos

<ancestralprimary>{Espíritu alentador}
Toca cerca de los tótems de los miembros del equipo caídos y los devuelve a la vida más rápido

column26:
สาย: <ancestralprimary>{ขัดขวางการคืนชีพ
เร่งความเร็วในการคืนชีพ}

พาสซีฟเผ่า: <enchanted>{ต้านทานคำสาป}

<ancestralprimary>{จับวิญญาณ (Spiritual Capture)}
เล่น​เพลง​ใกล้​กับ​ โทเทม​ของ​ศัตรู​ที่​ตาย เพื่อ​หยุด​เวลา​คืนชีพ 5 วินาที

<ancestralprimary>{อุ้มชูวิญญาณ (Bolstering Spirit)}
เล่น​เพลง​ใกล้กับ โทเทม​ของ​เพื่อน​ที่​ตาย เพื่อ​ให้​เขา​กลับ​มา​มี​ชีวิต​เร็ว​ขึ้น

column27:
特性: <ancestralprimary>{無法復活
加速復活}

部落天賦: <enchanted>{詛咒抗性}

<ancestralprimary>{靈魂捕手}
在靠近圖騰倒下的敵人演奏，阻止他們在 5 秒內復活

<ancestralprimary>{振奮靈魂}
在靠近圖騰倒下的隊員演奏，加速它們復活

column18:
Specialty: <ancestralprimary>{Area Fire Damage}

Tribal Passive: <enchanted>{Stun Resistant}

<ancestralprimary>{Echoing Cascade}
Slams the ground, creating molten cracks which deal damage in an area. Volcanos then erupt from the cracks

column19:
Spécialité : <ancestralprimary>{Dégâts de feu, de zone}

Passif tribal : <enchanted>{Résistant à l'Étourdissement}

<ancestralprimary>{Cascade résonnante}
Fracasse le sol, créant des fissures volcaniques qui infligent des dégâts dans une zone. Des volcans jaillissent ensuite des fissures

column20:
Spezialität: <ancestralprimary>{Feuer-Flächenschaden}

Stammes-Passive: <enchanted>{Widersteht Betäuben}

<ancestralprimary>{Widerhallende Kaskade}
Schlägt auf den Boden und erzeugt geschmolzene Risse, die Schaden in einem Bereich verursachen. Aus den Rissen erheben sich Vulkane

column21:
特技：<ancestralprimary>{範囲火ダメージ}

部族のパッシブ：<enchanted>{スタン耐性}

<ancestralprimary>{エコーニングカスケード}
地面を叩きつけ、一定範囲にダメージを与える溶けた亀裂を生成する。火山は亀裂から噴出する。

column22:
특기: <ancestralprimary>{범위 화염 피해}

부족 패시브: <enchanted>{기절 저항}

<ancestralprimary>{메아리치는 폭포}
지면을 강타하여 용암의 균열을 생성합니다. 균열은 일정 범위에 피해를 줍니다. 그 후 균열에서 화산이 솟아납니다.

column23:
Especialidade: <ancestralprimary>{Dano de Fogo em Área}

Passiva Tribal: <ancestralprimary>{Resistênte a Atordoamentos}

<ancestralprimary>{Cascata Ecoante}
Bate no solo, criando rachaduras vulcânicas que causam dano em área. Um Vulcão emerge das rachaduras

column24:
Специализация: <ancestralprimary>{Урон от огня по области}

Племенное умение: <enchanted>{Сопротивляется оглушению}

<ancestralprimary>{Гулкий каскад}
Наносит мощный удар по земле, создавая раскалённые трещины, которые наносят урон по области. Затем из трещин извергаются вулканы

column25:
Especialidad: <ancestralprimary>{Daño de fuego en área}

Pasiva tribal: <enchanted>{Resistente al aturdimiento}

<ancestralprimary>{Cascada repetidora}
Golpea el suelo para crear grietas fundidas que infligen daño en un área. A continuación unos volcanes entran en erupción desde las grietas

column26:
สาย: <ancestralprimary>{ความเสียหายพื้นที่ไฟ}

พาสซีฟเผ่า: <enchanted>{ต้านทานสถานะ มึนงง}

<ancestralprimary>{ทุบพื้นไล่เรียง (Echoing Cascade)}
ทุบ​พื้น เพื่อ​สร้าง​รอย​แยก​หิน​หลอม​ที่​สร้าง​ความ​เสียหาย​ใน​พื้นที่ จากนั้นภูเขาไฟจะระเบิดผ่านรอยแยกนี้

column27:
特性: <ancestralprimary>{範圍火焰傷害}

部落天賦: <enchanted>{暈眩抗性}

