重擊地面，製造熔岩裂縫造成範圍傷害。火山從裂縫中爆發。

column18:
Specialty: <ancestralprimary>{Revives Allies}

Tribal Passive: <enchanted>{Curse Resistant}

<ancestralprimary>{Spiritual Return}
Returns the spirit of an ally to the field, bringing them back to life

<ancestralprimary>{Cursed Totem}
Has a damaging chaos aura around their totem

column19:
Spécialité : <ancestralprimary>{Ranime les alliés}

Passif tribal :<enchanted>{Résistant aux Malédictions}

<ancestralprimary>{Restitution spirituelle}
Renvoie l'esprit d'un allié sur le terrain, le ramenant à la vie

<ancestralprimary>{Totem maudit}
Crée une aura qui inflige des Dégâts de chaos autour de son totem

column20:
Spezialität: <ancestralprimary>{Belebt Verbündete wieder}

Stammes-Passive: <enchanted>{Widersteht Flüchen}

<ancestralprimary>{Seelenrückkehr}
Bringt die Seele eines Verbündeten auf das Feld zurück und erweckt ihn wieder zum Leben

<ancestralprimary>{Verfluchtes Totem}
Hat um sein Totem herum eine schädigende Chaos-Aura

column21:
特技：<ancestralprimary>{味方を復活}

部族のパッシブ：<enchanted>{呪い耐性}

<ancestralprimary>{霊魂の帰還}
味方1体の霊魂をフィールドに呼び戻し、生き返らせる。

<ancestralprimary>{呪われたトーテム}
トーテムに混沌ダメージオーラを付与する。

column22:
특기: <ancestralprimary>{아군 부활}

부족 패시브: <enchanted>{저주 저항}

<ancestralprimary>{혼백 회귀}
아군의 혼백을 전장으로 다시 불러와 아군을 부활시킵니다.

<ancestralprimary>{저주받은 토템}
토템 주위에 피해를 주는 카오스 오라가 있습니다.

column23:
Especialidade: <ancestralprimary>{Revive Aliados}

Passiva Tribal: <ancestralprimary>{Resistênte a Maldições}

<ancestralprimary>{Retorno Espiritual}
Devolve o espírito de um aliado ao campo, ressuscitando-o

<ancestralprimary>{Totem Amaldiçoado}
Possui uma aura caótica ao redor do totem

column24:
Специализация: <ancestralprimary>{Возрождает союзников}

Племенное умение: <enchanted>{Сопротивляется проклятиям}

<ancestralprimary>{Возврат духа}
Возвращает дух союзника на поле боя, оживляя его

<ancestralprimary>{Проклятый тотем}
Собственный тотем окружён наносящей урон аурой хаоса

column25:
Especialidad: <ancestralprimary>{Revive aliados}

Pasiva tribal: <enchanted>{Resistente a las maldiciones}

<ancestralprimary>{Retorno espiritual}
Trae el espíritu de un aliado de vuelta al campo de batalla y lo devuelve a la vida

<ancestralprimary>{Tótem maldito}
Tiene un aura de caos que inflige daño alrededor de su tótem

column26:
สาย: <ancestralprimary>{คืนชีพเพื่อน}

พาสซีฟเผ่า: <enchanted>{ต้านทานคำสาป}

<ancestralprimary>{วิญญาณหวนคืน (Spiritual Return)}
ส่ง​วิญญาณ​ของ​เพื่อน​กลับ​คืน​สู่​สนาม เพื่อ​ให้​เขา​กลับ​มา​มี​ชีวิต​ใหม่

<ancestralprimary>{โทเทมต้องสาป}
โทเทม​ของ​เธอ มี​ออร่า​สร้าง​ความ​เสีย​หาย เคออส รอบ​ตัว

column27:
特性: <ancestralprimary>{復活友方}

部落天賦: <enchanted>{詛咒抗性}

<ancestralprimary>{靈魂轉世}
使有方的靈回重返戰場，讓他們復活

<ancestralprimary>{詛咒圖騰}
圖騰附近有傷害型混沌光環

column18:
Specialty: <ancestralprimary>{Area Cold Damage}

Tribal Passive: <enchanted>{Steals Mana}

<ancestralprimary>{Cold Breath}
Breathes out ice, dealing a large amount of cold damage and leaving chilled ground behind

column19:
Spécialité : <ancestralprimary>{Dégâts de froid, de zone}

Passif tribal : <enchanted>{Vole du Mana}

<ancestralprimary>{Souffle glacial}
Effectue un souffle glacial qui inflige d'importants dégâts de froid et frigorifie le sol dans son sillage

column20:
Spezialität: <ancestralprimary>{Flächen-Kälteschaden}

Stammes-Passive: <enchanted>{Stiehlt Mana}

<ancestralprimary>{Kalter Atem}
Haucht Eis aus, das großen Kälteschaden verursacht und unterkühlenden Boden hinterlässt

column21:
特技：<ancestralprimary>{範囲冷気ダメージ}

部族のパッシブ：<enchanted>{マナを盗む}

<ancestralprimary>{冷たい息}
氷の息を吐き、膨大な量の冷気ダメージを与え、息の跡に冷却領域を残す。

column22:
특기: <ancestralprimary>{범위 냉기 피해}

부족 패시브: <enchanted>{마나 훔침}

<ancestralprimary>{냉기 숨결}
얼음의 숨결을 내뿜어 큰 냉기 피해를 주고 얼음 지대를 남깁니다.

column23:
Especialidade: <ancestralprimary>{Dano de Gelo em Área}

Passiva Tribal: <ancestralprimary>{Roubo de Mana}

<ancestralprimary>{Sopro Glacial}
Sopra gelo, causando uma grande quantidade de dano de gelo e deixando solo resfriado no caminho

column24:
Специализация: <ancestralprimary>{Урон от холода по области}

Племенное умение: <enchanted>{Похищает ману}

<ancestralprimary>{Холодное дыхание}
Выдыхает лёд, нанося большой урон от холода и оставляя за собой замёрзшую землю

column25:
Especialidad: <ancestralprimary>{Daño de hielo en área}

Pasiva tribal: <enchanted>{Roba maná}

<ancestralprimary>{Aliento helado}
Exhala una ráfaga de hielo para infligir una gran cantidad de daño de hielo y dejar suelo escarchado a su paso

column26:
สาย: <ancestralprimary>{ความเสียหายพื้นที่น้ำแข็ง}

พาสซีฟเผ่า: <enchanted>{ขโมยมานา}

<ancestralprimary>{พ่นน้ำแข็ง (Cold Breath)}
พ่น​น้ำแข็ง​ออก​มา เพื่อ​สร้าง​ความ​เสียหาย น้ำแข็ง ขนาน​ใหญ่​และ​ทิ้ง พื้น​หนาว​เย็น เอา​ไว้

column27:
特性: <ancestralprimary>{範圍冰冷傷害}

部落天賦: <enchanted>{魔力竊取}

<ancestralprimary>{冰息}
呼出冰氣，造成大範圍冰冷傷害和留下冰緩地面

column18:
Specialty: <ancestralprimary>{True Stealth}

Tribal Passive: <enchanted>{Resists All Ailments}

<ancestralprimary>{True Stealth}
After 3 seconds of not attacking, the Tuatara is hidden from all monsters

<ancestralprimary>{Clone}
Summons a clone of itself

column19:
Spécialité : <ancestralprimary>{Furtivité inée}

Passif tribal : <enchanted>{Résistant à toutes les Altérations}

<ancestralprimary>{Furtivité inée}
Après avoir passé 3 secondes sans attaquer, le Tuatara se camoufle

<ancestralprimary>{Clonage}
Invoque un clone de lui même

column20:
Spezialität: <ancestralprimary>{Tarnung}

Stammes-Passive: <enchanted>{Widersteht allen Beeinträchtigungen}

<ancestralprimary>{Tarnung}
Nach 3 Sekunden, in denen der Tuatara nicht angreift, ist er vor allen Monstern verborgen

<ancestralprimary>{Klon}
Beschwört einen Klon von sich selbst

column21:
特技：<ancestralprimary>{真のステルス}

部族のパッシブ：<enchanted>{全状態異常耐性}

<ancestralprimary>{真のステルス}
3秒間攻撃しなかった場合、トゥアタラはすべてのモンスターから隠れる。

<ancestralprimary>{クローン}
自身のクローンを召喚する。

column22:
특기: <ancestralprimary>{진정한 은신}

부족 패시브: <enchanted>{모든 상태 이상 저항}

<ancestralprimary>{진정한 은신}
투아타라가 3초 동안 공격하지 않으면, 모든 몬스터에게서 숨습니다.

<ancestralprimary>{분신}
자신의 분신을 소환합니다.

column23:
Especialidade: <ancestralprimary>{Furtividade Verdadeira}

Passiva Tribal: <ancestralprimary>{Resiste a Todas as Afecções}

<ancestralprimary>{Furtividade Verdadeira}
Depois de 3 segundos sem atacar, o Tuatara se esconde de todos os monstros

<ancestralprimary>{Clone}
Convoca um clone de si mesmo

column24:
Специализация: <ancestralprimary>{Маскировка}

Племенное умение: <enchanted>{Сопротивляется всем состояниям}

<ancestralprimary>{Маскировка}
Спустя 3 секунды без совершения атак туатара скрывается ото всех монстров

<ancestralprimary>{Копия}
