部族のパッシブ：<enchanted>{敵のブロック率の一部を無視する
挑発の影響を受けない}

<ancestralprimary>{翡翠への封入}
一定時間経過後に魔法が噴火する拡大していく翡翠の領域を生成し、その中にいるすべての敵を翡翠の中に封じ込める。閉じ込められている間は、3回ヒットを受けるまで動けなくなる。

<ancestralprimary>{翡翠領域}
魔法が注入された翡翠の石の領域を作成する。敵が近づくと翡翠の石が噴出し、他の翡翠の石からも噴出する。

column22:
특기: <ancestralprimary>{비취로 피해를 주고 석화함}

부족 패시브: <enchanted>{일부 적 막기 확률 무시
도발의 영향을 받지 않음}

<ancestralprimary>{비취 감옥}
점점 넓어지는 비취 밭을 만듭니다. 비취 밭은 일정 시간 후에 마법으로 분출하여 안에 있는 모든 적을 비취 안에 가둡니다. 비취에 갇힌 적은 3번 피격당할 때까지 움직일 수 없습니다.

<ancestralprimary>{비취 밭}
마법이 깃든 비취가 가득한 밭을 만듭니다. 적이 가까이 오면 비취가 폭발하며, 다른 비취들도 폭발하게 만듭니다.

column23:
Especialidade: <ancestralprimary>{Causa Dano e Petrifica com Jade}

Passiva Tribal: <ancestralprimary>{Ignora parte da Chance de Bloqueio Inimiga
Não Afetado Por Provocações}

<ancestralprimary>{Envolver em Jade}
Envolve um inimigo em jade por 5 segundos. Enquanto envolvido em jade, ele não pode se mover até que seja acertado três vezes

<ancestralprimary>{Campo de Jade}
Cria um campo de pedras de jade infundidas com magia. Quando um inimigo se aproximar, a pedra de jade irrompe, fazendo com que as outras pedras de jade também irrompam.

column24:
Специализация: <ancestralprimary>{Наносит урон и накладывает окаменение}

Племенное умение: <enchanted>{Игнорирует некоторый процент шанса блока противника
Невосприимчива к провокации}

<ancestralprimary>{Заточение в нефрите}
Создаёт растущее поле нефрита, через некоторое время заключающее всех противкников в нём в нефрит. Будучи заточённым, противник не может двигаться, пока не получит три удара

<ancestralprimary>{Поле нефрита}
Создаёт поле наполненных магией нефритовых камней. При приближении противника камни взрываются, по цепочке взрывая и другие нефритовые камни.

column25:
Especialidad: <ancestralprimary>{Inflige daño y petrifica con jade}

Pasiva tribal: <enchanted>{Ignora una parte de la probabilidad de bloqueo de los enemigos
No le afecta la provocación}

<ancestralprimary>{Encierro de jade}
Crea un campo de jade creciente que estalla con magia después de un tiempo y encierra a todos los enemigos de su interior en jade. Mientras están encerrados en jade, no pueden moverse hasta que los golpeen tres veces

<ancestralprimary>{Campo de jade}
Crea un campo de piedras de jade imbuído con magia. Cuando un enemigo se acerca, las piedras de jade estallan, lo cual provoca a su vez que las otras piedras de jade estallen también

column26:
สาย: <ancestralprimary>{สร้างความเสียหายและทำให้แข็งเป็นหยก}

พาสซีฟเผ่า: <enchanted>{มองข้ามโอกาสบล็อคบางส่วนของศัตรู
ไม่ได้รับผลจากสถานะ ยั่วยุ}

<ancestralprimary>{ผนึกหยก (Encase in Jade)}
สร้าง สนามหยก ที่​ขยาย​ตัว​ออก​ไป​เรื่อยๆ และ​ระเบิด​ออก​มา​เป็น​เวท​เมื่อ​เวลา​ผ่าน​ไป​พัก​หนึ่ง สร้าง​สถานะ ผนึกหยก ต่อ​ศัตรู​ทุก​ตัว​ที่​อยู่​ใน​พื้นที่ ขณะ​ที่​ศัตรู​มี​สถานะ​นี้ พวก​มัน​ไม่​สามารถ​เคลื่อนที่​ได้​จนกว่า​จะ​ถูก​ปะทะ 3 ครั้ง

<ancestralprimary>{สนามหยก (Jade Field)}
สร้าง​สนาม​ที่​เต็ม​ไป​ด้วย​หิน​หยก​ที่​อาบ​เวท เมื่อ​ศัตรู​เดิน​เข้า​มา​ใกล้ หิน​หยก​เหล่า​นี้​จะ​ระเบิด ทำให้​หิน​หยก​อื่นๆ ระเบิด​ตาม​เช่นกัน

column27:
特性: <ancestralprimary>{造成傷害和玉石化}

部落天賦: <enchanted>{無視部分敵人格擋率
不被嘲諷影響}

<ancestralprimary>{囚玉}
將敵人困在玉中。困在玉中時，敵人不能移動，要打 3 下才能敲破

<ancestralprimary>{保玉}
創造一片充滿魔法的玉石領域。當敵人靠近時，玉石會爆發，引起其他玉石也爆發

column18:
Specialty: <ancestralprimary>{Creates Walls to Block Enemies}

Tribal Passive: <enchanted>{Cannot be Slowed Below Base
Overwhelms Physical Damage Reduction}

<ancestralprimary>{Rapid Construction}
Creates a series of wooden walls that blocks the movement of enemies

column19:
Spécialité : <ancestralprimary>{Crée des murs pour bloquer les Ennemis}

Passif tribal : <enchanted>{Ne peut être ralenti en deçà de sa valeur de base
Submerge la Réduction des Dégâts physiques}

<ancestralprimary>{Construction rapide}
Crée des séries de murs en bois qui bloquent les mouvements des ennemis

column20:
Spezialität: <ancestralprimary>{Erzeugt Mauern, die Gegner blocken}

Stammes-Passive: <enchanted>{Kann nicht unter Basiswert verlangsamt werden
Überwältigt physische Schadensminderung}

<ancestralprimary>{Schneller Bau}
Erzeugt eine Reihe von Holzwänden, die die Bewegung von Gegnern blockieren

column21:
特技：<ancestralprimary>{敵を防ぐ壁を作成}

部族のパッシブ：<enchanted>{減速状態にならずスタンを受けることがない
物理ダメージ軽減を圧倒する}

<ancestralprimary>{高速建築}
敵の移動を妨げる一連の木製の壁を作成する。

column22:
특기: <ancestralprimary>{적을 막는 벽 생성}

부족 패시브: <enchanted>{기본 속도 밑으로 느려지지 않음
물리 피해 감소 압도}

<ancestralprimary>{빠른 건설}
적의 이동을 막는 여러 개의 나무 벽을 생성합니다.

column23:
Especialidade: <ancestralprimary>{Cria Paredes par Bloquear Inimigos}

Passiva Tribal: <ancestralprimary>{Não Pode ser Desacelerado Abaixo da Base
Sobrecarrega a Redução de Dano Físico}

<ancestralprimary>{Construção Ágil}
Cria uma série de paredes de madeira que bloqueiam o movimento dos inimigos

column24:
Специализация: <ancestralprimary>{Создаёт стены для препятствия противникам}

Племенное умение: <enchanted>{Нельзя замедлить сильнее базовой скорости
Подавляет уменьшение получаемого физического урона}

<ancestralprimary>{Быстрое строительство}
Создаёт череду деревянных стен, мешающих продвижению противников

column25:
Especialidad: <ancestralprimary>{Construye muros para bloquear a los enemigos}

Pasiva tribal: <enchanted>{No se puede ralentizar por debajo de la base
Sobrepasa la reducción de daño físico}

<ancestralprimary>{Construcción veloz}
Construye una serie de muros de madera para bloquear el movimiento de los enemigos

column26:
สาย: <ancestralprimary>{สร้างกำแพงกีดขวางศัตรู}

พาสซีฟเผ่า: <enchanted>{ไม่สามารถถูกทำให้เชื่องช้าไปกว่าความเร็วพื้นฐาน
ท่วมท้น ค่าป้องกันกายภาพ}

<ancestralprimary>{ก่อสร้างว่องไว (Rapid Construction)}
สร้าง​กำแพง​ไม้ ชุด​หนึ่ง​เพื่อ​กีดขวาง​การ​เคลื่อนที่​ของ​ศัตรู

column27:
特性: <ancestralprimary>{製造牆隔擋敵人}

部落天賦: <enchanted>{不能被緩速低於基礎
鎮壓物理傷害減免}

<ancestralprimary>{迅速打造}
製造許多木牆來阻擋敵人移動

column18:
Specialty: <ancestralprimary>{Protects Totems
Cleanses Enemy Totems}

Tribal Passive: <enchanted>{Stun Resistant}

<ancestralprimary>{Cleanse with Fire}
Bathes an enemy totem in fire, removing all buffs from it

<ancestralprimary>{Molten Shell}
A molten shell encases a totem. The shell will explode when an enemy tries to destroy the totem

column19:
Spécialité : <ancestralprimary>{Protège les Totems
Purifie les Totems ennemis}

Passif tribal : <enchanted>{Résistant à l'Étourdissement}

<ancestralprimary>{Purifier par le feu}
Enflamme un totem ennemi, lui retirant tous ses effets bénéfiques

<ancestralprimary>{Carapace volcanique}
Une carapace volcanique enveloppe un totem. La carapace explose lorsqu'un ennemi essaye de détruire le totem

column20:
Spezialität: <ancestralprimary>{Schützt Totems
Reinigt gegnerische Totems}

Stammes-Passive: <enchanted>{Widersteht Betäuben}

<ancestralprimary>{Reinigung mit Feuer}
Badet ein gegnerisches Totem in Feuer und entfernt alle Stärkungen davon

<ancestralprimary>{Geschmolzene Hülle}
Eine geschmolzene Hülle umschließt ein Totem. Die Hülle explodiert, wenn ein Gegner versucht, das Totem zu zerstören

column21:
特技：<ancestralprimary>{トーテムを守り、敵のトーテムを洗浄}

部族のパッシブ：<enchanted>{スタン耐性}

<ancestralprimary>{火による浄化}
敵のトーテムに火を浴びせ、トーテムが持つすべてのバフを取り除く。

<ancestralprimary>{モルテンシェル}
モルテンシェルがトーテムを包み、敵がトーテムを破壊しようとした時に爆発する。

column22:
특기: <ancestralprimary>{토템 보호
적 토템 정화}

부족 패시브: <enchanted>{기절 저항}

<ancestralprimary>{불의 정화}
적 토템 1개를 불로 휩싸 해당 토템에 적용 중인 버프를 모두 제거합니다.

<ancestralprimary>{용암 방패}
용암 방패가 토템을 둘러쌉니다. 적이 토템을 파괴하려 하면 용암 방패가 폭발합니다.

column23:
Especialidade: <ancestralprimary>{Protege os Totens
Purifica os Totens Inimigos}

Passiva Tribal: <ancestralprimary>{Resistênte a Atordoamentos}

<ancestralprimary>{Purificação Ardente}
Banha um totem inimigo em fogo, removendo todos os buffs dele

<ancestralprimary>{Escudo Flamejante}
Um escudo flamejante envolve um totem. O escudo explodirá quando um inimigo tentar destruir o totem

column24:
Специализация: <ancestralprimary>{Защищает тотемы
Очищает тотемы противника}

Племенное умение: <enchanted>{Сопротивляется оглушению}

<ancestralprimary>{Очищение огнём}
Окутывает тотем противника огнём, снимая с него все положительные эффекты

<ancestralprimary>{Расплавленный панцирь}
Покрывает тотем расплавленным панцирем. При попытке противника уничтожить тотем панцирь взорвётся

column25:
Especialidad: <ancestralprimary>{Protege tótems
Purifica los totems de los enemigos}

Pasiva tribal: <enchanted>{Resistente al aturdimiento}

<ancestralprimary>{Purificar con fuego}
Rocía un tótem enemigo con fuego para eliminar todas sus bonificaciones

<ancestralprimary>{Coraza fundida}
Recubre un tótem con una coraza fundida. La coraza explotará cuando un enemigo trate de destruir el tótem

column26:
สาย: <ancestralprimary>{ปกป้องโทเทม
ชำระล้างโทเทมศัตรู}

พาสซีฟเผ่า: <enchanted>{ต้านทานสถานะ มึนงง}

<ancestralprimary>{ชำระล้างด้วยเพลิง (Cleanse with Fire)}
เท​เพลิง​ให้​ท่วม โทเทม​ศัตรู เพื่อ​กำจัด​บัฟ​ทุกอย่าง​ที่​มัน​มี

<ancestralprimary>{กระดองหลอมละลาย (Molten Shell)}
กระดอง​หลอมละลาย ห่อ​หุ้ม​โทเทม​หนึ่ง เพื่อ​ให้​ระเบิด​ออก​เมื่อ​ศัตรู​พยายาม​ทำลาย​โทเทม​นี้

column27:
特性: <ancestralprimary>{保護圖騰
淨化敵人圖騰}

部落天賦: <enchanted>{暈眩抗性}

<ancestralprimary>{火焰淨化}
讓敵人圖騰身陷火海，移除它全部的增益

<ancestralprimary>{熔岩護盾}
熔岩護盾包覆圖騰。當敵人嘗試摧毀圖騰時，護盾會爆炸

column18:
Specialty: <ancestralprimary>{Ensnares Enemies}

Tribal Passive: <enchanted>{Steals Flask Charges}

<ancestralprimary>{Ensnare}
Throws a spear. When it strikes an enemy a rope ensnares them, slowing them the further from the Spearfisher they are

column19:
Spécialité : <ancestralprimary>{Entrave les Ennemis}

Passif tribal : <enchanted> {Vole les Charges de Flacon}

<ancestralprimary>{Entrave}
Jette une lance. Lorsque celle-ci frappe un ennemi, une corde l'entrave. Plus il s'éloigne de la Pêcheuse à la lance, plus il est ralenti

column20:
Spezialität: <ancestralprimary>{Fesselt Gegner}

Stammes-Passive: <enchanted>{Stiehlt Fläschchenfüllungen}

<ancestralprimary>{Fesselt}
Wirft einen Speer. Wenn er einen Gegner trifft, wird er von einem Seil umschlungen, das ihn verlangsamt, je weiter er vom Speerfischer entfernt ist

column21:
特技：<ancestralprimary>{敵を拘束}

部族のパッシブ：<enchanted>{フラスコチャージを盗む}

<ancestralprimary>{エンスネア}
槍を投げる。槍が敵に当たった場合、ロープで敵を拘束する。拘束された敵はスピアフィッシャーから遠ざかるほど遅くなる。

column22:
특기: <ancestralprimary>{적을 올가미 덫으로 잡음}

부족 패시브: <enchanted>{플라스크 충전 훔침}

<ancestralprimary>{올가미 덫}
창을 던집니다. 창에 맞은 적은 밧줄에 걸려 느려집니다. 해당 적과 창 낚시꾼의 거리가 멀수록 감속 효과가 강해집니다.

column23:
Especialidade: <ancestralprimary>{Aprisiona Inimigos}

Passiva Tribal: <ancestralprimary>{Roubo de Cargas de Frasco}

<ancestralprimary>{Envolver}
Arremessa uma lança. Quando ela golpear um inimigo, uma corda o envolverá, retardando-o baseado na distância que estiver do Lanceiro Pescador

column24:
Специализация: <ancestralprimary>{Опутывает врагов}

Племенное умение: <enchanted>{Похищает заряды флаконов}

<ancestralprimary>{Опутывание}
Бросает острогу. При попадании в противника опутывает его верёвкой, замедляя тем сильнее, чем дальше противник от рыбака с острогой

column25:
Especialidad: <ancestralprimary>{Amarra a los enemigos}

Pasiva tribal: <enchanted>{Roba cargas de frascos}

<ancestralprimary>{Amarre}
Arroja una lanza. Cuando golpea a un enemigo, lo amarra con una cuerda para ralentizarlo, y lo ralentiza más cuanto más lejos esté de la Pescadora lancera

column26:
สาย: <ancestralprimary>{จับศัตรู}

พาสซีฟเผ่า: <enchanted>{ขโมยชาร์จขวดยา}

<ancestralprimary>{จับ (Ensnare)}
โยน​หอก​ออก​ไป เพื่อ​ให้​เชือก​จับ​ศัตรู​ที่​ถูก​หอก​ปะทะ ยิ่ง​มัน​อยู่​ห่าง​จาก​นัก​จับ​ปลา​เท่าไร มัน​ยิ่ง​เชื่องช้า​ลง​เท่านั้น

column27:
特性: <ancestralprimary>{誘捕敵人}

部落天賦: <enchanted>{藥劑充能竊取}

<ancestralprimary>{誘捕}
投擲長矛。當它命中敵人時，一根繩子會纏繞住他們，並距離長矛漁夫越遠時減慢他們的速度

column18:
Specialty: <ancestralprimary>{Gives Ancestral Totems a Second Life}

Tribal Passive: <enchanted>{Curse Resistant}

<ancestralprimary>{Totemic Fortification}
Empowers an allied totem, allowing it to return to full life after being destroyed

<ancestralprimary>{Prophetic Return}
Returns an enemy to where they were standing 4 seconds ago

column19:
Spécialité : <ancestralprimary>{Donne une Seconde Vie aux Totems ancestraux}

Passif tribal : <enchanted>{Résistant aux Malédictions}

<ancestralprimary>{Fortification totémique}
Améliore un totem allié, lui permettant de revenir à la vie avec toute sa vie après sa destruction

{Rappel prophétique}
Rappelle un ennemi à l'endroit où il se trouvait 4 secondes auparavant

column20:
Spezialität: <ancestralprimary>{Gibt Ahnen-Totems ein zweites Leben}

Stammes-Passive: <enchanted>{Widersteht Flüchen}

<ancestralprimary>{Totem-Verstärkung}
Stärkt ein verbündetes Totem, sodass es nach seiner Zerstörung mit vollem Leben zurückkehrt

<ancestralprimary>{Prophetische Rückkehr}
Versetzt einen Gegner dorthin zurück, wo er vor 4 Sekunden stand

column21:
特技：<ancestralprimary>{先祖のトーテムに第二の命を付与}

部族のパッシブ：<enchanted>{呪い耐性}

<ancestralprimary>{トーテムの補強}
味方のトーテムを強化し、破壊された後にフルライフに回復する。

<ancestralprimary>{予言された帰還}
敵を4秒前に立っていた場所に戻す。

column22:
특기: <ancestralprimary>{선조 토템에 두 번째 생명 부여}

부족 패시브: <enchanted>{저주 저항}

<ancestralprimary>{토템 방어 상승}
아군 토템을 강화합니다. 강화된 토템은 파괴된 후에 최대 생명력 상태로 돌아갑니다.

<ancestralprimary>{예견된 귀환}
적을 4초 전의 위치로 돌려보냅니다.

column23:
Especialidade: <ancestralprimary>{Dá aos Totens Ancestrais uma Segunda Vida}

Passiva Tribal: <ancestralprimary>{Resistênte a Maldições}

<ancestralprimary>{Fortificação Totêmica}
Maximiza um totem aliado, permitindo que ele tenha a vida recuperada totalmente após ser destruído

<ancestralprimary>{Retorno Profético}
Retorna um inimigo para onde ele estava 4 segundos atrás

column24:
Специализация: <ancestralprimary>{Дарует тотемам предков вторую жизнь}

Племенное умение: <enchanted>{Сопротивляется проклятиям}

<ancestralprimary>{Укрепление тотемов}
Усиливает дружественный тотем, восполняя ему здоровье до максимума после уничтожения

<ancestralprimary>{Пророческое возвращение}
Возвращает противника на то место, где он был 4 секунды назад

column25:
Especialidad: <ancestralprimary>{Da una segunda vida a los tótems ancestrales}

Pasiva tribal: <enchanted>{Resistente a las maldiciones}

<ancestralprimary>{Fortificación totémica}
Potencia un tótem aliado para permitirle que vuelva a la vida tras ser destruido

<ancestralprimary>{Retorno profético}
Devuelve a un enemigo a la ubicación en la que estaba hacía 4 segundos

column26:
สาย: <ancestralprimary>{ทำให้โทเทมต้นตระกูลมีชีวิตที่สอง}

พาสซีฟเผ่า: <enchanted>{ต้านทานคำสาป}

<ancestralprimary>{เสริมกำลังโทเทม (Totemic Fortification)}
เสริม​พลัง​ให้​กับ โทเทม​เพื่อน เพื่อ​ให้​กลับ​มา​มี​พลัง​ชีวิต​เต็ม​หลัง​จาก​ที่​ถูก​ทำลาย

<ancestralprimary>{หวนคืนตามคำทำนาย (Prophetic Return)}
ส่ง​ตำแหน่ง​ของ ศัตรู คืน​สู่​ที่​ที่​มัน​เคย​ยืน​อยู่​เมื่อ 4 วินาที​ก่อน

column27:
特性: <ancestralprimary>{給祖靈圖騰第二春}

部落天賦: <enchanted>{詛咒抗性}

<ancestralprimary>{圖騰護身}
賦予友方圖騰，使它們被摧毀時可以滿血重生

<ancestralprimary>{先知返回}
將敵人返回他 4 秒前的位置

column18:
Specialty: <ancestralprimary>{Casts Lightning Spells
Warps Enemies Backwards}

Tribal Passive: <enchanted>{Critical Resistant}

<ancestralprimary>{Storm's Passage}
Creates a sigil under a nearby enemy, and a second sigil towards the enemy side. After 4 seconds warps all enemies in the first sigil to the second sigil

<ancestralprimary>{Conduit of Power}
Channels lightning forward for 5 seconds, then releases a powerful blast of lightning

column19:
Spécialité : <ancestralprimary>{Lance des Sorts de foudre
Téléporte les Ennemis vers l'arrière}

Passif tribal : <enchanted>{Résistant aux Critiques}

<ancestralprimary>{Passage de l'orage}
Crée un sceau en dessous d'un ennemi à proximité puis crée un second sceau en direction du camp ennemi. Après 4 secondes, téléporte tous les ennemis se trouvant dans le premier sceau vers le second sceau.

<ancestralprimary>{Catalyseur de puissance}
Canalise de la foudre devant elle pendant 5 secondes, puis libère une puissante explosion de foudre

column20:
Spezialität: <ancestralprimary>{Zaubert Blitzzauber
Teleportiert Gegner rückwärts}

Stammes-Passive: <enchanted>{Widersteht kritischen Treffern}

<ancestralprimary>{Sturmpassage}
Erzeugt ein Siegel unter einem Gegner im Umkreis und ein zweites Siegel auf der gegnerischen Seite. Nach 4 Sekunden werden alle Gegner im ersten Siegel in das zweite Siegel teleportiert

<ancestralprimary>{Energieleitung}
Kanalisiert Blitze für 5 Sekunden und setzt dann einen mächtigen Blitzstrahl frei

column21:
特技：<ancestralprimary>{雷スペルをキャスト
敵を後方にワープ}

部族のパッシブ：<enchanted>{クリティカル耐性}

<ancestralprimary>{嵐の通路}
近くの敵の下に最初の印および敵側に向けて2番目の印を作成する。4秒後、最初の印の内側のすべての敵を2番目の印にワープさせる。

<ancestralprimary>{力の導管}
前方に向けて雷を5秒間チャネリングした後、強力な雷の爆発を解き放つ。

column22:
특기: <ancestralprimary>{번개 주문 시전
적을 뒤로 차원 이동시킴}

부족 패시브: <enchanted>{치명타 저항}

<ancestralprimary>{폭풍의 길}
주변의 적 1명 아래에 표식을 생성하고, 적 쪽에 표식을 1개 더 생성합니다. 4초 후 첫 번째 표식 안에 있는 모든 적을 두 번째 표식으로 순간이동시킵니다.

<ancestralprimary>{힘의 영매}
5초 동안 전방에 번개를 불러낸 후 강력한 번개 폭발을 일으킵니다.

column23:
Especialidade: <ancestralprimary>{Conjura Magias de Raio
Teleporta Inimigos para Trás}

Passiva Tribal: <ancestralprimary>{Resistênte a Críticos}

<ancestralprimary>{Tormenta Passageira}
Cria um emblema nos pés de um inimigo próximo, e um segundo emblema ao lado do inimigo. Após 4 segundos, teleporta todos os inimigos no primeiro emblema para o segundo

<ancestralprimary>{Condutor de Energia}
Canaliza eletricidade adiante por 5 segundos, liberando uma explosão poderosa de raio

column24:
Специализация: <ancestralprimary>{Сотворяет чары молнии
Перемещает противников назад}

Племенное умение: <enchanted>{Сопротивляется критическим ударам}

<ancestralprimary>{Сквозь бурю}
Создаёт печать под ближайшим противником и вторую печать на стороне противника. Через 4 секунды переносит всех противников с первой печати ко второй

<ancestralprimary>{Проводник силы}
Заряжает молнию в течение 5 секунд, затем выпускает мощный разряд

column25:
Especialidad: <ancestralprimary>{Lanza hechizos de rayo
Teletransporta a los enemigos hacia atrás}

Pasiva tribal: <enchanted>{Resistente a los golpes críticos}

<ancestralprimary>{Pasaje de la tormenta}
Coloca una runa bajo un enemigo cercano y una segunda runa hacia el lado del enemigo. Tras 4 segundos, teletransporta a todos los enemigos de la primera a la segunda runa

<ancestralprimary>{Canalización de poder}
Canaliza el poder del rayo hacia delante durante 5 segundos y luego libera una poderosa explosión de rayo

column26:
สาย: <ancestralprimary>{ร่ายเวทสายฟ้า
วาร์ปศัตรูให้ถอยหลัง}

พาสซีฟเผ่า: <enchanted>{ต้านทานคริติคอล}

<ancestralprimary>{ทางผ่านวายุ (Storm's Passage)}
สร้าง ตรา​สัญลักษณ์​แรก ข้าง​ใต้​ศัตรู​ที่​อยู่​ใกล้ แล้ว​สร้าง ตราสัญลักษณ์​ที่​สอง ไป​ทาง​ฝั่ง​ศัตรู เพื่อ​วาร์ป​ศัตรู​ทุก​ตัว​ที่​อยู่​บน​ตรา​สัญลักษณ์​แรก​ไป​ยัง​ตรา​สัญลักษณ์​ที่​สอง​ใน 4 วินาทีถัดมา

<ancestralprimary>{รวบรวมพลัง (Conduit of Power)}
แชนเนล​สายฟ้า​ไป​ข้างหน้า 5 วินาที เพื่อ​ปล่อย​สายฟ้า​อัน​ทรง​พลัง​ออก​มา

column27:
特性: <ancestralprimary>{施放閃電法術
把敵人往後傳送}

部落天賦: <enchanted>{暴擊抗性}

<ancestralprimary>{通風}
在附近敵人下標記，並朝敵人方向製造地 2 個標記。4 秒後將第 1 個標記上的全部敵人傳送至第 2 個標記

<ancestralprimary>{導管之力}
向前引導施放閃電 5 秒，並釋放強大的電能砲

column18:
Specialty: <ancestralprimary>{Stuns and Knocks Back Enemies}

Tribal Passive: <enchanted>{Cannot be Slowed Below Base
Overwhelms Physical Damage Reduction}

<ancestralprimary>{Stunning Slam}
Slams the ground, dealing damage and stunning anything caught in the shockwave

column19:
Spécialité : <ancestralprimary>{Étourdit et Repousse les Ennemis}

Passif tribal : <enchanted>{Ne peut être ralenti en deçà de sa valeur de base
Submerge la Réduction des Dégâts physiques}

<ancestralprimary>{Fracas Étourdissant}
Fracasse le sol, infligeant des dégâts et étourdissant tout ce qui se trouve dans l'onde de choc

column20:
Spezialität: <ancestralprimary>{Betäubt und stößt Gegner zurück}

Stammes-Passive: <enchanted>{Kann nicht unter Basiswert verlangsamt werden
Überwältigt physische Schadensminderung}

<ancestralprimary>{Betäubender Hieb}
Schlägt auf den Boden, verursacht Schaden und betäubt alles, was von der Schockwelle erfasst wird

column21:
特技：<ancestralprimary>{敵をスタンおよびノックバック}

部族のパッシブ：<enchanted>{減速状態にならずスタンを受けることがない
物理ダメージ軽減を圧倒する}

<ancestralprimary>{スタンスラム}
地面を叩きつけてダメージを与えると共に、衝撃波に捕まったすべてをスタンさせる。

column22:
특기: <ancestralprimary>{적을 기절시키고 밀어냄}

부족 패시브: <enchanted>{기본 속도 밑으로 느려지지 않음
물리 피해 감소 압도}

<ancestralprimary>{기절 강타}
지면을 강타하여 충격파에 휘말린 모든 대상에 피해를 주고 기절시킵니다.

column23:
Especialidade: <ancestralprimary>{Atordoa e Empurra Inimigos}

Passiva Tribal: <ancestralprimary>{Não Pode ser Desacelerado Abaixo da Base
Sobrecarrega a Redução de Dano Físico}

<ancestralprimary>{Impacto Atordoador}
Bate no solo, causando dano e atordoando tudo que for pego na onda de choque

column24:
Специализация: <ancestralprimary>{Оглушает и отбрасывает противников}

Племенное умение: <enchanted>{Нельзя замедлить сильнее базовой скорости
Подавляет уменьшение получаемого физического урона}

<ancestralprimary>{Оглушающий удар}
С силой бьёт по земле, нанося урон и оглушая всё, что окажется в зоне действия ударной волны

column25:
Especialidad: <ancestralprimary>{Aturde y empuja a los enemigos}

Pasiva tribal: <enchanted>{No se puede ralentizar por debajo de la base
Sobrepasa la reducción de daño físico}

<ancestralprimary>{Embate aturdidor}
Golpea el suelo para infligir daño y aturdir a todo lo que alcance la onda expansiva

column26:
สาย: <ancestralprimary>{สร้างสถานะมึนงงและผลักศัตรูออกไป}

พาสซีฟ: <enchanted>{ไม่ถูกทำให้เชื่องช้าไปกว่าความเร็วพื้นฐาน
ท่วมท้น ค่าป้องกันกายภาพ}

<ancestralprimary>{ทุบมึนงง (Stunning Slam)}
ทุบ​พื้น เพื่อ​สร้าง​ความ​เสียหาย​และ​สร้าง​สถานะ มึนงง ต่อ​ทุกอย่าง​ที่​อยู่​ใต้​คลื่น​พลัง​นั้น

column27:
特性: <ancestralprimary>{暈眩和擊退敵人}

部落天賦: <enchanted>{不能被緩速低於基礎
鎮壓物理傷害減免}

<ancestralprimary>{暈眩之擊}
重擊地面，造成傷害並使被震波震到的敵人暈眩

column18:
Specialty: <ancestralprimary>{Prevents Reviving
Revives on Death}

Tribal Passive: <enchanted>{Ignores some Enemy Block Chance
Unaffected By Taunt}

<ancestralprimary>{Jade Spirit}
When the Jade Shaman dies, a Spirit of Jade is summoned and continues fighting for 10 seconds

<ancestralprimary>{Buried in Jade}
When the Jade Shaman kills an enemy, their corpse is encased in jade, pausing their revive for 10 seconds. The corpse cannot be revived by Teammates while encased in jade.

<ancestralprimary>{Jade Slice}
Smashes the ground, sending forward a wave of jade

column19:
Spécialité : <ancestralprimary>{Empêche la Réapparition
Réapparait en mourant}

Passif tribal : <enchanted>{Ignore une partie des chances de Bloquer ennemi
Insensibilité à la Provocation}

<ancestralprimary>{Esprit de jade}
Lorsque le Chaman de jade meurt, un esprit de jade est invoqué et continue de se battre pendant 10 secondes

<ancestralprimary>{Enterré dans le jade}
Lorsque le Chaman de jade tue un ennemi, son cadavre est enveloppé dans du jade, l'empêchant de réapparaître pendant 10 secondes. Le cadavre ne peut être ranimer tant qu'il est enveloppé de jade.

<ancestralprimary>{Taillade de Jade}
Frappe le sol, envoyant vers l'avant une vague de jade

column20:
Spezialität: <ancestralprimary>{Verhindert das Wiederbeleben
Wird bei Tod wiederbelebt}

Stammes-Passive: <enchanted>{Ignoriert teilweise gegnerische Blockchance
Unbeeinträchtigt von Verspotten}

<ancestralprimary>{Jadegeist}
Wenn der Jadeschamane stirbt, wird ein Jadegeist beschworen, der 10 Sekunden lang weiterkämpft

<ancestralprimary>{Jadebegräbnis}
Wenn der Jadeschamane einen Gegner tötet, wird dessen Leichnam mit Jade bedeckt, was dessen Wiederbelebung für 10 Sekunden verhindert. Der Leichnam kann nicht von Teammitgliedern wiederbelebt werden, solange er von Jade bedeckt ist.

<ancestralprimary>{Jadeschlag}
Schlägt auf den Boden und sendet eine Welle von Jade aus

column21:
特技：<ancestralprimary>{復活の妨害
死亡時に復活}

部族のパッシブ：<enchanted>{敵のブロック率の一部を無視する
挑発の影響を受けない}

<ancestralprimary>{翡翠の霊魂}
翡翠のシャーマンが死亡した時、翡翠の霊魂を召喚し、引き続き10秒間戦う。

<ancestralprimary>{翡翠内への埋葬}
翡翠のシャーマンが敵を倒した時、その死体を翡翠で包みそのリスポーンを10秒間阻害する。翡翠に包まれている死体はチームメイトによって復活させられることがない。

<ancestralprimary>{翡翠の薄片}
地面を叩き、翡翠の波を前方に繰り出す。

column22:
특기: <ancestralprimary>{부활 방지
사망 시 부활}

부족 패시브: <enchanted>{일부 적 막기 확률 무시
도발의 영향을 받지 않음}

<ancestralprimary>{비취 혼백}
비취 주술사가 사망하면 비취 혼백이 소환되어 10초 동안 전투를 계속합니다.

<ancestralprimary>{비취 무덤}
비취 주술사가 적을 처치하면 해당 적의 시신을 비취로 감싸 10초 동안 부활을 멈추게 합니다. 해당 시신이 비취로 감싸진 상태에서는 팀원이 부활시킬 수 없습니다.

<ancestralprimary>{비취 조각}
지면을 강타해 전방으로 비취 파도를 내보냅니다.

column23:
Especialidade: <ancestralprimary>{Impede Ressurgimentos
Ressurge ao Morrer}

Passiva Tribal: <ancestralprimary>{Ignora parte da Chance de Bloqueio Inimiga
Inafetado Por Provocações}

<ancestralprimary>{Espírito de Jade}
Quando um Xamã de Jade morre, um Espírito de Jade é convocado e continua lutando por 10 segundos

<ancestralprimary>{Coberto por Jade}
Quando um Xamã de Jade mata um inimigo, seu cadáver é coberto em jade, impetindo seu ressurgimento por 10 segundos

<ancestralprimary>{Pancada de Jade}
Golpeia o solo, enviando uma onda de jade adiante

column24:
Специализация: <ancestralprimary>{Предотвращает возрождение
Возрождается при смерти}

Племенное умение: <enchanted>{Игнорирует некоторый процент шанса блока противника
Невосприимчив к провокации}

<ancestralprimary>{Дух нефрита}
После смерти нефритового шамана возникает дух нефрита, продолжающий сражаться ещё 10 секунд

<ancestralprimary>{Погребение в нефрите}
Когда нефритовый шаман убивает противника, его труп покрывает нефрит, не позволяя возрождаться в течение 10 секунд. Труп нельзя возродить, пока он покрыт нефритом.

<ancestralprimary>{Срез нефрита}
Бьёт по земле, посылая вперёд волну нефрита

column25:
Especialidad: <ancestralprimary>{Impide la resurrección
Revive al morir}

Pasiva tribal: <enchanted>{Ignora una parte de la probabilidad de bloqueo de los enemigos
No le afecta la provocación}

<ancestralprimary>{Espíritu de jade}
Cuando el Chamán de jade muere, se invoca un espíritu de jade que sigue peleando durante 10 segundos

<ancestralprimary>{Enterrado en jade}
Cuando el Chamán de jade mata a un enemigo, su cadáver queda recubierto de jade, lo cual pausa su resurrección durante 10 segundos. El cadáver no puede revivir mientras esté recubierto de jade.

<ancestralprimary>{Corte de jade}
Golpea el suelo para enviar una ola de jade hacia delante

column26:
สาย: <ancestralprimary>{ขัดขวางการคืนชีพ
คืนชีพเมื่อตาย}

พาสซีฟเผ่า: <enchanted>{มองข้ามโอกาสบล็อคบางส่วนของศัตรู
ไม่ได้รับผลจากสถานะ ยั่วยุ}

<ancestralprimary>{วิญญาณหยก (Jade Spirit)}
เมื่อ​คนทรง​หยก​ตาย จะ​อัญเชิญ วิญญาณ​หยก มา​ต่อสู้​ต่อ​ไปเป็นเวลา 10 วินาที

<ancestralprimary>{ฝังไว้ใต้หยก (Buried in Jade)}
เมื่อ​คนทรง​หยก​สังหาร​ศัตรู ศพ​ของ​มัน​จะ​ถูก​ฝัง​ไว้​ใน​หยก หยุด​เวลา​คืนชีพของ​มัน​เป็นเวลา 10 วินาที โดย​เพื่อนร่วมทีม​จะ​ไม่สามารถ​คืนชีพ​ให้​กับ​ศพ​​ที่​ติด​สถานะ ฝังไว้ใต้หยก

<ancestralprimary>{หยกเฉือน (Jade Slice)}
ทุบพื้น เพื่อ​ส่ง​คลื่น​หยก​ไป​ข้างหน้า

column27:
特性: <ancestralprimary>{防止復活
死亡時復活}

部落天賦: <enchanted>{無視部分敵人格擋率
不被嘲諷影響}

<ancestralprimary>{玉靈}
當玉石薩滿死亡時，會召喚玉靈再戰 10 秒

<ancestralprimary>{埋玉}
當玉石薩滿擊殺敵人時，他們的屍體會被玉石包覆，阻止它們在 10 秒內復活。屍體被玉包覆時不能復活

<ancestralprimary>{玉片}
重擊地面，釋放一股玉充擊波

column18:
Specialty: <ancestralprimary>{Mobile}

Tribal Passive: <enchanted>{Evasive and Accurate}

<ancestralprimary>{Engage}
The dancer dashes forward, thrusting a spear in the direction they are heading

<ancestralprimary>{Disengage}
The dancer steps backwards, thrusting a spear in the direction they came from

column19:
Spécialité : <ancestralprimary>{Mobile}

Passif tribal : <enchanted>{Évasive et Précise}

<ancestralprimary>{Engagement}
La danseuse s'élance vers l'avant, portant un coup avec la pointe de sa lance dans cette même direction.

{Désengagement}
La danseuse fait un bond vers l'arrière, portant un coup avec la pointe de sa lance en direction d'où elle se trouvait

column20:
Spezialität: <ancestralprimary>{Mobil}

Stammes-Passive: <enchanted>{Ausweichend und treffgenau}

<ancestralprimary>{Angriff}
Der Tänzer stürmt vorwärts und stößt einen Speer in die gleiche Richtung

<ancestralprimary>{Rückzug}
Der Tänzer geht rückwärts und stößt einen Speer in die Richtung, aus der er kam

column21:
特技：<ancestralprimary>{機動性}

部族のパッシブ：<enchanted>{高回避、高命中}

<ancestralprimary>{エンゲージ}
踊り子は前方にダッシュし、進んだ方向に向けて槍を突く。

<ancestralprimary>{ディスエンゲージ}
踊り子は飛び下がり、来た方向に向けて槍を突く。

column22:
특기: <ancestralprimary>{기동성}

부족 패시브: <enchanted>{회피 및 정확도}

<ancestralprimary>{교전}
창의 무희가 앞으로 돌진하며 그 방향으로 창을 내지릅니다.

<ancestralprimary>{철수}
창의 무희가 뒤로 물러나며 원래 있던 위치 방향으로 창을 내지릅니다.

column23:
Especialidade: <ancestralprimary>{Móvel}

Passiva Tribal: <ancestralprimary>{Evasivo e Preciso}

<ancestralprimary>{Atacar}
O dançarino avança, empurrando a lança na direção que estiver seguindo

<ancestralprimary>{Separar}
O dançarino retorna, empurrando a lança na direção de onde veio

column24:
Специализация: <ancestralprimary>{Мобильность}

Племенное умение: <enchanted>{Уклонение и меткость}

<ancestralprimary>{Наступление}
Танцовщица совершает рывок вперёд, бросая копьё в направлении движения

<ancestralprimary>{Отступление}
Танцовщица поворачивает назад, бросая копьё в направлении, из которого пришла

column25:
Especialidad: <ancestralprimary>{Movilidad}

Pasiva tribal: <enchanted>{Evasiva y precisa}

<ancestralprimary>{Avance}
La bailarina corre hacia delante y arroja una lanza en la dirección a la que se dirige

<ancestralprimary>{Retroceso}
La bailarina retrocede y arroja una lanza en la dirección de la que proviene

column26:
